import React from 'react';
import { BrowserRouter as Router} from 'react-router-dom';

import './App.css';
import NavBar from './components/navBar/NavBar';
import Body from './components/body/Body'

function App() {

  return (
    <div className='page'>
      <Router></Router>
      <NavBar/>

      <Body>
        <Router/>
      </Body>
    </div>
  );
}

export default App;
